import React from "react";
import {
  Containner,
  FormWrap,
  Icon,
  FormContent,
  Form,
  FormH1,
  FormLabel,
  FormInput,
  FormButton,
  Text,
} from "./ReusmeElements";

const Reusme = () => {
  return (
    <>
      <Containner>
        <FormWrap>
          <Icon to="/">Googi</Icon>
          <FormContent>
            <Form action="#">
              <FormH1>
                E-Mail를 입력해주시면 보내드리도록 하겠습니다. 감사합니다.
              </FormH1>
              <FormLabel htmlFor="for">Email</FormLabel>
              <FormInput type="email" required />
              <FormButton type="submit">제출</FormButton>
            </Form>
          </FormContent>
        </FormWrap>
      </Containner>
      ;
    </>
  );
};

export default Reusme;
